Using whiskered composition, the unit of the
  composite adjunction is \bar {\eta } = 1_C\xrightarrow {\eta } GF\xrightarrow {G\eta ' F} GG'F'F, while the
  counit is \bar {\epsilon } = F'FGG'\xrightarrow {F'\epsilon  G'} F'G' \xrightarrow {\epsilon '}   1_E. It now suffices to establish the triangle
  identities. The left triangle identity is witnessed by commutativity
  of




    \usepackage{tikz, tikz-cd, mathtools, amssymb}
  \usetikzlibrary{shapes.geometric}
  \usetikzlibrary{calc}
  \usetikzlibrary{matrix}
  \usetikzlibrary{decorations.markings}

  \tikzset{
    % basics
    square/.style={draw, regular polygon, regular polygon sides=4},
    triangle/.style={draw, regular polygon, regular polygon sides=3},
  }

  \tikzset{
    % string diagrams
    state/.style={triangle, shape border rotate=180, anchor=north},
    costate/.style={triangle, anchor=south},
    morphism/.style={draw, rectangle},
    over/.style={
      draw=white,
      double=black,
      % default is .4pt
      line width=1.2pt,
      double distance=.4pt,
      text=black
    },
  }

  \tikzset{ 
    % tables
    % https://tikz.net/tikz-table/
    table/.style={
        matrix of nodes,
        row sep=-\pgflinewidth,
        column sep=-\pgflinewidth,
        nodes={
            rectangle,
            draw=black,
            align=center
        },
        minimum height=1.5em,
        text depth=0.5ex,
        text height=2ex,
        nodes in empty cells,
%%
        every even row/.style={
            nodes={fill=gray!20}
        },
        column 1/.style={
            nodes={font=\bfseries}
        },
        row 1/.style={
            nodes={
                fill=black,
                text=white,
                font=\bfseries
            }
        }
    }
  }


    \begin {tikzcd}
      F'F\ar [rr, "F'F\eta "]\ar [rrrr, bend left, "F'F\bar {\eta }"]\ar [drdr, "F'
      1_F"]\ar [drdrdrdr, "1_{F'F}"', bend right] && F'FGF\ar [rr,
      "F'FG\eta ' F"]\ar [dd, "F'\epsilon  F"]
      && F'FGG'F'F\ar [dd, "F'\epsilon  G'F' F"']\ar [dddd, "\bar {\epsilon }F'F",
      bend left=50] \\
      \\
      & & F'F\ar [drdr, "1_{F'} F"']\ar [rr, "F'\eta ' F"] & & F'G'F'F\ar [dd,
      "\epsilon ' F'F"'] \\
      \\
      & & & & F'F\makebox [0pt][l]{.}
    \end {tikzcd}


 Indeed, the top and right triangles are the definition of \bar {\eta } and
  \bar {\epsilon }, the top-right square is the interchange law, the
  top-left and bottom-right triangles are the left triangle identities for the
  given adjunctions, and the bottom-left square is unitality. The right triangle
  identity is similar.

